def get_digits(n):
    digits = []
    while n > 0:
        digits.append(n % 10)
        n = n // 10
    return digits


def get_digits_count(n):
    digits = get_digits(n)
    count = 0
    for digit in digits:
        if digit == 1:
            count += 1
    return count


def get_min_digits_count(n):
    digits_count = get_digits_count(n)
    min_digits_count = digits_count
    while n > 0:
        digits_count = get_digits_count(n)
        if digits_count < min_digits_count:
            min_digits_count = digits_count
        n = n // 10
    return min_digits_count


